import React from "react";
import './style.css';
import { MyToDoItem } from "../../types";
import { useNavigate } from "react-router-dom";

//              interface: 나의 투두 리스트 아이템 컴포넌트 Props               //
interface Props {
    myToDoItem: MyToDoItem;
}

//              component: 나의 투두 리스트 아이템 컴포넌트             //
export default function MyToDoListItem({ myToDoItem }: Props) {

    //              state: Properties               //
    const { userListNumber, userListContent, userListCheck } = myToDoItem;

    // //              function: 네비게이트 함수               //
    // const navigator = useNavigate();

    // //        event handler: 추천 스터디 클릭 이벤트 처리 함수       //
    // const onRecommendationStudyClickHandler = () => {
    //     navigator(STUDYROOM_DETAIL_PATH(studyNumber));
    // }

    //              render: 추천 스터디 Top5 리스트 아이템 컴포넌트 렌더링             //
    return (
        <div className='main-top-down-todolist-detail'>
            <div className='main-top-down-todolist-check-icon-box'>
                <div className='todolist-non-check-icon'></div>
            </div>
            <div className='main-top-down-todolist-detail-text'>
                <div className='main-top-down-todolist-detail-textvalue'>{''}</div>
            </div>
        </div>
    );
}




{tab.studyRoomToDoList.map((item, todoIndex) => (
